		<script>
			var pagePreloaderElement;
			var PRELOADER = {
				isStopped: false,
				awaitedAnimations: [
					"animation_1-1",
					"animation_2-1",
					"animation_3-1",
					"animation_4-1",
					"animation_5-1",
					"animation_6-1",
				],
				animationDispatcher: function animationDispatcher(event) {
					console.log(event.animationName);

					if (PRELOADER.awaitedAnimations.length > 0) {
						PRELOADER.awaitedAnimations =
							PRELOADER.awaitedAnimations.filter(
								(animationName) =>
									event.animationName !== animationName
							);
						return;
					} else {
						if (pagePreloaderElement) {
							pagePreloaderElement.classList.add("welcome");
							setTimeout(() => {
								pagePreloaderElement.classList.add("_complete");
							}, 400);
						}
					}

					if (event.animationName !== "animation_infinitee") {
						return;
					}

					if (PRELOADER.isStopped) {
						event.target.classList.add("_complete");
					} else {
						event.target.classList.remove("_complete");
					}
				},
			};

			document.addEventListener("DOMContentLoaded", function () {
				pagePreloaderElement =
					document.querySelector("#page-preloader");

				pagePreloaderElement.addEventListener(
					"animationiteration",
					PRELOADER.animationDispatcher,
					false
				);
				pagePreloaderElement.addEventListener(
					"webkitAnimationIteration",
					PRELOADER.animationDispatcher,
					false
				);

				pagePreloaderElement.addEventListener(
					"animationend",
					PRELOADER.animationDispatcher,
					false
				);
				pagePreloaderElement.addEventListener(
					"webkitAnimationEnd",
					PRELOADER.animationDispatcher,
					false
				);
			});
			function togglePreloaderAnimation() {
				PRELOADER.isStopped = !PRELOADER.isStopped;
			}
